angular.module("templatescache", []).run(["$templateCache", function($templateCache) {$templateCache.put("./pages/home.html","<div id=home class=\"jumbotron starter-template\"><h1>PHP Static Analysis</h1><p class=lead>It\'s time to check your project ;)</p><div class=row><a class=\"btn btn-success btn-sm\" href=http://github.com/ovr/phpsa target=_blank><i class=\"fa fa-github\"></i> Source code on Github</a><iframe src=\"http://ghbtns.com/github-btn.html?user=ovr&repo=phpsa&type=watch&count=true&size=large\" allowtransparency=true frameborder=0 scrolling=0 width=160px height=30px style=\"vertical-align: bottom;\"></iframe></div></div><article class=\"markdown-body entry-content\" itemprop=mainContentOfPage><p><a href=https://travis-ci.org/ovr/phpsa><img src=https://camo.githubusercontent.com/77adbc8e9379b851d44d943f459819da034b8e66/68747470733a2f2f7472617669732d63692e6f72672f6f76722f70687073612e7376673f6272616e63683d6d6173746572 alt=\"Build Status\" data-canonical-src=\"https://travis-ci.org/ovr/phpsa.svg?branch=master\" style=max-width:100%;></a> <a href=\"https://scrutinizer-ci.com/g/ovr/phpsa/?branch=master\"><img src=https://camo.githubusercontent.com/d718b8d6a358906dce8feb37537d2daf3697dbcf/68747470733a2f2f7363727574696e697a65722d63692e636f6d2f672f6f76722f70687073612f6261646765732f7175616c6974792d73636f72652e706e673f623d6d6173746572 alt=\"Scrutinizer Code Quality\" data-canonical-src=\"https://scrutinizer-ci.com/g/ovr/phpsa/badges/quality-score.png?b=master\" style=max-width:100%;></a> <a href=\"https://scrutinizer-ci.com/g/ovr/phpsa/?branch=master\"><img src=https://camo.githubusercontent.com/5efa087a02fd0c86e2863ba83b31a4868476a8b9/68747470733a2f2f7363727574696e697a65722d63692e636f6d2f672f6f76722f70687073612f6261646765732f636f7665726167652e706e673f623d6d6173746572 alt=\"Code Coverage\" data-canonical-src=\"https://scrutinizer-ci.com/g/ovr/phpsa/badges/coverage.png?b=master\" style=max-width:100%;></a> <a href=https://packagist.org/packages/ovr/phpsa><img src=https://camo.githubusercontent.com/627c0b16fef39bfff5a9c798aad651e18bbb9d43/68747470733a2f2f706f7365722e707567782e6f72672f6f76722f70687073612f762f737461626c652e737667 alt=\"Latest Stable Version\" data-canonical-src=https://poser.pugx.org/ovr/phpsa/v/stable.svg style=max-width:100%;></a> <a href=https://packagist.org/packages/ovr/phpsa><img src=https://camo.githubusercontent.com/513176e22a62b00b595a589a9d69e0438f63ff1e/68747470733a2f2f706f7365722e707567782e6f72672f6f76722f70687073612f6c6963656e73652e737667 alt=License data-canonical-src=https://poser.pugx.org/ovr/phpsa/license.svg style=max-width:100%;></a></p><blockquote><p>PHPSA is a development tool aimed at bringing static analysis for PHP applications and libraries.</p></blockquote><p>P.S This software is currently in early alpha state, any contributions/stars will be awesome.</p><h2><a id=user-content-goals class=anchor href=#goals aria-hidden=true><span class=\"octicon octicon-link\"></span></a>Goals</h2><p>What is needed or planned as future.</p><h4><a id=user-content-unused class=anchor href=#unused aria-hidden=true><span class=\"octicon octicon-link\"></span></a>Unused</h4><ul class=task-list><li class=task-list-item><input type=checkbox class=task-list-item-checkbox disabled> Import</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox checked disabled> Local variable</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox disabled> Parameter</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox disabled> Private field</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox disabled> Private method</li></ul><h4><a id=user-content-undefined class=anchor href=#undefined aria-hidden=true><span class=\"octicon octicon-link\"></span></a>Undefined</h4><ul class=task-list><li class=task-list-item><input type=checkbox class=task-list-item-checkbox disabled> Class</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox checked disabled> Class constant</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox checked disabled> Class property</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox checked disabled> Class method</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox disabled> Callback</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox disabled> Constant</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox disabled> Function</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox disabled> Namespace</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox checked disabled> Variable</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox disabled> Callback</li></ul><h4><a id=user-content-phpdockblock class=anchor href=#phpdockblock aria-hidden=true><span class=\"octicon octicon-link\"></span></a>PHPDockblock</h4><ul class=task-list><li class=task-list-item><input type=checkbox class=task-list-item-checkbox checked disabled> Missing doc block</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox disabled> Missing @return</li></ul><h4><a id=user-content-control-flow class=anchor href=#control-flow aria-hidden=true><span class=\"octicon octicon-link\"></span></a>Control flow</h4><ul class=task-list><li class=task-list-item><input type=checkbox class=task-list-item-checkbox disabled> Loop which does not loop</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox disabled> Ternary operator simplification</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox disabled> Elvis operator can be used</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox disabled> Not optimal if conditions</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox disabled> Infinity loop</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox disabled> Unreachable statement</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox checked disabled> Stupid cast</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox checked disabled> Not implemented class methods</li></ul><h4><a id=user-content-probable-bugs class=anchor href=#probable-bugs aria-hidden=true><span class=\"octicon octicon-link\"></span></a>Probable bugs</h4><ul class=task-list><li class=task-list-item><input type=checkbox class=task-list-item-checkbox checked disabled> Division by zero {expr}/0</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox checked disabled> Division from zero 0/{expr}</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox disabled> Missing \'break\' statement</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox disabled> Void function result used</li></ul><h4><a id=user-content-general class=anchor href=#general aria-hidden=true><span class=\"octicon octicon-link\"></span></a>General</h4><ul class=task-list><li class=task-list-item><input type=checkbox class=task-list-item-checkbox disabled> Language level</li><li class=task-list-item><input type=checkbox class=task-list-item-checkbox checked disabled> Syntax error</li></ul><h2><a id=user-content-installation class=anchor href=#installation aria-hidden=true><span class=\"octicon octicon-link\"></span></a>Installation</h2><h3><a id=user-content-composer class=anchor href=#composer aria-hidden=true><span class=\"octicon octicon-link\"></span></a>Composer</h3><p>The recommended way to install phpsa is via <code>composer</code>.</p><ol><li>If you do not have composer installed, download the <a href=https://getcomposer.org/composer.phar><code>composer.phar</code></a> executable or use the installer.</li></ol><div class=\"highlight highlight-sh\"><pre>$ curl -sS https://getcomposer.org/installer <span class=pl-k>|</span> php</pre></div><ol><li>Run <code>php composer.phar require ovr/phpsa</code> or add requirement in composer.json.</li></ol><div class=\"highlight highlight-json\"><pre>{\n  <span class=pl-s><span class=pl-pds>\"</span>require<span class=pl-pds>\"</span></span>: {\n    <span class=pl-s><span class=pl-pds>\"</span>ovr/phpsa<span class=pl-pds>\"</span></span>: <span class=pl-s><span class=pl-pds>\"</span>*<span class=pl-pds>\"</span></span>\n  }\n}</pre></div><ol><li>Run <code>php composer.phar update</code></li></ol><h2><a id=user-content-how-to-use class=anchor href=#how-to-use aria-hidden=true><span class=\"octicon octicon-link\"></span></a>How to use</h2><div class=\"highlight highlight-sh\"><pre>$ ./bin/phpsa\nPHP Static Analyzer version 0.1-dev <span class=pl-c>#fbdf4d4</span>\n\nUsage:\n  <span class=pl-c1>command</span> [options] [arguments]\n\nOptions:\n  -h, --help            Display this <span class=pl-c1>help</span> message\n  -q, --quiet           Do not output any message\n  -V, --version         Display this application version\n      --ansi            Force ANSI output\n      --no-ansi         Disable ANSI output\n  -n, --no-interaction  Do not ask any interactive question\n  -v<span class=pl-k>|</span>vv<span class=pl-k>|</span>vvv, --verbose  Increase the verbosity of messages: 1 <span class=pl-k>for</span> <span class=pl-smi>normal</span> output, 2 <span class=pl-k>for</span> <span class=pl-smi>more</span> verbose output and 3 <span class=pl-k>for</span> <span class=pl-smi>debug</span>\n\nAvailable commands:\n  check  SPA\n  <span class=pl-c1>help</span>   Displays <span class=pl-c1>help</span> <span class=pl-k>for</span> <span class=pl-smi>a</span> <span class=pl-c1>command</span>\n  list   Lists commands</pre></div><p>Example output:</p><div class=\"highlight highlight-sh\"><pre>$ ./bin/phpsa check ./tests/\n\nIt is highly recommended to disable the XDebug extension before invoking this <span class=pl-c1>command</span>.\nScanning directory ./tests/simple\nfound 10 files\n\nSyntax error:  Syntax error, unexpected <span class=pl-s><span class=pl-pds>\'</span>}<span class=pl-pds>\'</span></span> on line 8 <span class=pl-k>in</span> ./tests/simple/syntax-error/1.php\n\nNotice:  Unused variable <span class=pl-smi>$a</span> <span class=pl-k>in</span> method <span class=pl-en>test</span>() <span class=pl-k>in</span> ./tests/simple/unused-variable/1.php  [unused-variable]\n\nNotice:  Property a is not exists on this scope <span class=pl-k>in</span> ./tests/simple/undefined/Property.php on 9 [undefined-property]\n\n     <span class=pl-k>return</span> <span class=pl-smi>$this</span>-<span class=pl-k>&gt;</span>a<span class=pl-k>;</span>\n\nNotice:  Constant BBBB is not exists on self scope <span class=pl-k>in</span> ./tests/simple/undefined/Const.php on 14 [undefined-const]\n\n     <span class=pl-k>return</span> self::BBBB<span class=pl-k>;</span>\n\nNotice:  Method <span class=pl-en>b</span>() is not exists on this scope <span class=pl-k>in</span> ./tests/simple/undefined/MCall.php on 7 [undefined-mcall]\n\n     <span class=pl-k>return</span> <span class=pl-smi>$this</span><span class=pl-en>-&gt;b</span>();\n\nNotice:  You trying to use undefined variable <span class=pl-smi>$unusedVariable</span> <span class=pl-k>in</span> ./tests/simple/undefined/MCall.php on 23 [undefined-variable]\n\n     <span class=pl-k>return</span> <span class=pl-smi>$unusedVariable</span><span class=pl-en>-&gt;b</span>();\n\nNotice:  Function <span class=pl-en>undefinedFunction</span>() is not exists <span class=pl-k>in</span> ./tests/simple/undefined/FCall.php on 7 [undefined-fcall]\n\n     <span class=pl-en>undefinedFunction</span>();\n\nNotice:  You trying to use undefined variable <span class=pl-smi>$b</span> <span class=pl-k>in</span> ./tests/simple/undefined/LocalVariable.php on 8 [undefined-variable]\n\n     <span class=pl-k>return</span> <span class=pl-smi>$a</span> + <span class=pl-smi>$b</span><span class=pl-k>;</span>\n\nNotice:  Static method <span class=pl-en>b</span>() is not exists on self scope <span class=pl-k>in</span> ./tests/simple/undefined/SCall.php on 7 [undefined-scall]\n\n     <span class=pl-k>return</span> <span class=pl-en>self::b</span>();\n\nNotice:  You trying to use division on {expr}/0 <span class=pl-k>in</span> ./tests/simple/devision-by-zero/1.php on 7 [division-zero]\n\n     <span class=pl-k>return</span> 1000 / 0<span class=pl-k>;</span>\n\nNotice:  You trying to use division on {expr}/0 <span class=pl-k>in</span> ./tests/simple/devision-by-zero/1.php on 12 [division-zero]\n\n     <span class=pl-k>return</span> 1000 / (100-100)<span class=pl-k>;</span>\n\nNotice:  You trying to use division on {expr}/0 <span class=pl-k>in</span> ./tests/simple/devision-by-zero/1.php on 17 [division-zero]\n\n     <span class=pl-k>return</span> 1000 / <span class=pl-s><span class=pl-pds>((</span><span class=pl-c1>50</span><span class=pl-k>+</span><span class=pl-c1>50</span>)<span class=pl-k>-</span><span class=pl-c1>100</span>);</span>\n<span class=pl-s></span>\n<span class=pl-s>Notice:  You trying to use division on {expr}/<span class=pl-c1>0</span> in ./tests/simple/devision-by-zero/<span class=pl-c1>1</span>.php on <span class=pl-c1>22</span> [division-zero]</span>\n<span class=pl-s></span>\n<span class=pl-s>     return <span class=pl-c1>1000</span> / ((<span class=pl-c1>5</span>*<span class=pl-c1>5</span>)-<span class=pl-c1>25</span>);</span>\n<span class=pl-s></span>\n<span class=pl-s>Notice:  You trying to use division on {expr}/<span class=pl-c1>0</span> in ./tests/simple/devision-by-zero/<span class=pl-c1>1</span>.php on <span class=pl-c1>27</span> [division-zero]</span>\n<span class=pl-s></span>\n<span class=pl-s>     return <span class=pl-c1>1000</span> / ((-<span class=pl-c1>25</span>) + (<span class=pl-c1>5</span>*<span class=pl-c1>5</span><span class=pl-pds>))</span></span><span class=pl-k>;</span>\n\nNotice:  You trying to use division on {expr}/0 <span class=pl-k>in</span> ./tests/simple/devision-by-zero/1.php on 32 [division-zero]\n\n     <span class=pl-k>return</span> 1000 / <span class=pl-s><span class=pl-pds>((</span><span class=pl-k>-</span><span class=pl-c1>4</span>) <span class=pl-k>+</span> (<span class=pl-c1>5</span>^<span class=pl-c1>1</span><span class=pl-pds>))</span></span><span class=pl-k>;</span>\n\nNotice:  You trying to use division from 0/{expr} <span class=pl-k>in</span> ./tests/simple/devision-by-zero/1.php on 37 [division-zero]\n\n     <span class=pl-k>return</span> 0 / 1000<span class=pl-k>;</span>\n\nMemory usage: 4.97 (peak: 5.25) MB</pre></div><h2><a id=user-content-requirements class=anchor href=#requirements aria-hidden=true><span class=\"octicon octicon-link\"></span></a>Requirements</h2><ul><li>PHP &gt;= 5.3 (compatible up to version 7.0 &amp;&amp; hhvm)</li></ul><h2><a id=user-content-license class=anchor href=#license aria-hidden=true><span class=\"octicon octicon-link\"></span></a>LICENSE</h2><p>MIT, Have fun</p></article>");}]);